	.sapUiRtaOverlayHover {
		&:after {
			border: none;
			transition: none;
			box-shadow: none;
			outline: 0.125rem dotted @_sap_ui_rta_Overlay_BorderColor; //2px
			outline-offset: -0.125rem; //2px
		}
	}

	.sapUiDtOverlay {
		&:focus {
			outline: none;
			/* We create inner white shadow to make sure black border is in contrast with element */
			box-shadow: 0 0 0 2px @_sap_ui_rta_Overlay_BoxShadowColor inset;

			&:before {
				border: none;
				outline: 0.125rem dotted @_sap_ui_rta_Overlay_HoverBorder; //2px
				outline-offset: -0.25rem; //4px
			}
		}
	}

	.sapUiDtOverlaySelected {
		transition: none;
		box-shadow: none;

		&:after {
			border: 0.125rem solid @_sap_ui_rta_Overlay_BorderColor; //2px
			outline: none;
		}

		&.sapUiDtOverlayFocusable {
			&:focus {
				/* Same trick as described above but doubled thickness */
				box-shadow: 0 0 0 4px @_sap_ui_rta_Overlay_BoxShadowColor inset;
			}
		}

		&.sapUiRtaOverlayHover {
			&:after {
				border: 0.125rem solid @_sap_ui_rta_Overlay_BorderColor !important; //2px
				outline: 0.125rem dotted @_sap_ui_rta_Overlay_BorderColor !important; //2px
				outline-offset: -0.25rem; //4px
				transition: none;
				box-shadow: none;
			}
